import React from 'react';
import './App.css';
import Header from './components/Header';
import Hero from './components/Hero';
import WebinarAgenda from './components/WebinarAgenda';
import ImageSection from './components/ImageSection';
import ProblemSection from './components/ProblemSection';
import lightStreak from './assets/light-streak.png';
import lightStreak0 from './assets/light-streak0.png';

function App() {
  return (
    <div className="App bg-[#040615] min-h-screen">
      {/* Background Light Streaks */}
      <div className="light-streak-container">
        <img 
          src={lightStreak} 
          alt="Light streak" 
          className="light-streak-1"
          onError={(e) => console.log('Light streak 1 failed to load')}
          onLoad={() => console.log('Light streak 1 loaded successfully')}
        />
        <img 
          src={lightStreak0} 
          alt="Light streak 0" 
          className="light-streak-2"
          onError={(e) => console.log('Light streak 2 failed to load')}
          onLoad={() => console.log('Light streak 2 loaded successfully')}
        />
        <img 
          src={lightStreak} 
          alt="Light streak" 
          className="light-streak-3"
          onError={(e) => console.log('Light streak 3 failed to load')}
          onLoad={() => console.log('Light streak 3 loaded successfully')}
        />
      </div>

      <Header />
      <Hero />
      <WebinarAgenda />
      <ImageSection />
      <ProblemSection />
    </div>
  );
}

export default App;
